  //--->thunk -->redux-thunk
//  reducer,action
import { connect, Connect } from "react-redux"
function App({variable}){
  return(
    <div>
      <center>
      <h3>React-Redux</h3>
      <p>{variable}</p>
      </center>
    </div>
  )
  
}
const mapStateToProps=state=>({
  variable:state

})

export default connect(mapStateToProps) (App);
